15 jours, j’ai mis 15 jours à sortir mon showreel 2022 ! Du coup je comprendrai si vous prenez pas la peine de le regarder.
Mais si jamais vous le faite, vous verrez les meilleurs shoots de l’année, des gens incroyables, et ma sainte personne à l’âge de 4 ans qui vous offre une démonstration de ski de fond si vous allez jusqu’à la fin.
Ça se passe sur ma chaine YouTube, le lien est dans ma bio 🤓 (ça va c’est 2 clic pour y aller)

