Ah ça y est ! On peut l’annoncer ! 🤩
@domaine_des_saints_peres X @roussetracing, si ça a pas de la gueule ça. En même temps, la dernière fois qu’on a vu quelque chose d’aussi stylé, c’était l’époque où on n’était pas obligé d’expliquer que « Non, on fait du ski de fond, on a pas de carabine sur le dos » et « oui, on le fait en patinant et aussi dans les rails, les deux quoi. » « Ah bon, mais vous faites comment pour choisir ? » « Ça dépend, on regarde l’orientation du soleil et on sacrifie une chèvre et selon le bruit qu’elle fait, on décide de l’un ou l’autre. »
Bref, on est vachement content de cette association, bien trop belle pour nous. Ça va être chouette!🦉 
